const WeatherBox = ({weather}) => { //props라는 object에서 weather을 가지고 온다는 의미이다.
    console.log("weather?",weather);
  return (
    <div className="weather-box"> 
      <div>{weather.name}}</div>
      <h2>30도 / 230화씨</h2>
      <h3>맑은하늘입니다.</h3>
    </div>
  )
}

export default WeatherBox
